export const initialState = {
  mainPosts: [{
    id: 1,
    Usesr: {
      id: 1,
      nickname : '삭은이',
      content: '첫번째 게시글 #태그'
    }
  }],
};

const reducer = (state = initialState, action) => {
  switch (action.type) {
    default:
      return state;
  }
};

export default reducer;
